import React, { useState } from 'react';
import { Card } from '../../Card/Card';
import { InputUI } from '../InputUI/InputUI';

import img from '../../img/Goku.jpg';
import axios from 'axios';

export const GifExpertApp = (event) => {

  const [cards, setCards] = useState({title:"Gokú",image:img});
  const URL = "https://api.giphy.com/v1/stickers/search?";
  const api_key = "api_key=I4ub2ABDFChWF6nfeWp8yNiJIhRNDpsF";
  const query = "&q="

  const getGifs = () => {
    axios.get(`${URL}${api_key}${query}${event.target.value}`)
    .then(response => {
      setCards(response.data.data);

    })
    .catch(error => {
      console.log(error);
    })
  }

  return(
    <div className='div-gif'>
      <h1>Gif Expert App</h1>
      <InputUI
        holder="Look Somethings"
        event={getGifs}
      />
      <hr />
      <main className='main-card'>
        <Card image={cards.image} title={cards.title}/>
        <Card image={cards.image} title={cards.title}/>
        <Card image={cards.image} title={cards.title}/>
        <Card image={cards.image} title={cards.title}/>
        <Card image={cards.image} title={cards.title}/>
        <Card image={cards.image} title={cards.title}/>      
      </main>
    </div>
  )
}
